#pragma endregion 
void cpyCardback(const int tbC[][IMGWidth]) {
	for (int i = 0; i < Cardback_Height; i++)
		for (int j = 0; j < Cardback_Width; j++)
			fillerCard[i][j] = tbC[i][j];
}
void drawCardback(int x, int y) {
	cpyCardback(Cardback_ARRY);
	for (int i = 0; i < Cardback_Height; i++)
		for (int j = 0; j < Cardback_Width; j++)
			if (fillerCard[i][j] != 99)
				putpixel(x + j, y + i, fillerCard[i][j]);
}
